  false,\n\t\"url\": null,\n\t\"notes\": \"This data collection comprises seasonal
  distribution maps and model outputs of selected seabird, pinniped and cetacean species
  off the Pacific coast of Washington. The maps were developed by predicting relative
  density using associative models linking at-sea species observations with environmental
  covariates. Seabird, pinniped and cetacean observations were compiled from federal,
  state and NGO monitoring programs with data between 1995 and 2014. Environmental
  covariates were processed from long-term archival satellite, oceanographic and hydrographic
  databases.nnSelected species include: Marbled Murrelet (Brachyramphus marmoratus),
  Rhinoceros Auklet (Cerorhinca monocerata), Tufted Puffin (Fratercula cirrhata),
  Common Murre (Uria aalge), Black-footed Albatross (Phoebastria nigripes), Northern
  Fulmar (Fulmarus glacialis), Pink-footed Shearwater (Puffinus creatopus), Sooty
  Shearwater (Puffinus griseus), Steller sea lion (Eumetopias jubatus), harbor seal
  (Phoca vitulina), humpback whale (Megaptera novaeangliae), gray whale (Eschrichtius
  robustus), harbor porpoise (Phocoena phocoena) and Dallu00e2u0080u0099s porpoise
  (Phocoenoides dalli). Summer season (April to October) predictions were developed
  for all species. In addition, winter season (November to March) predictions were
  developed for Rhinoceros Auklet, Common Murre and Black-footed Albatross.nnThe collection
  includes multiple geospatial model outputs for each species and season combination.
  Data are grouped into seabird, pinniped and cetacean datasets, and each dataset
  includes its own data documentation record.\",\n\t\"license_title\": null,\n\t\"extras\":
